trailingComments.value:
*
 * Video player based on HTML5 `<video>` tag.
 *
 * @example
 * const url = 'https://url/to/video'
 * const video = new Video(url, {
 *   width: 750,
 *   height: 1500,
 * })
 *
 * class Theater extends Scene {
 *   onAdded() {
 *     this.addChild(video)
 *   }
 * }

